section5/gitbook.html.body:
Gitbook Plugins!Gitbook Plugins representan una buena opci&#xF3;n si queremos extender las funcionalidades de nuestro Gitbook.
Entre estas funcionalidades destacan: incorporar videos de Youtube, ejercicios, incorporar f&#xF3;rmulas matem&#xE1;ticas, campos para introducir comentarios, ...
Podemos encontrar los Gitbook plugins que nos interesen en Plugins Gitbook&#xBF;C&#xF3;mo podemos instalar un plugin?
Creamos fichero book.json siguiendo la estructura:
{
    &quot;gitbook&quot;: &quot;0.0.1&quot;,
    &quot;title&quot;: &quot;Gitbook para apuntes. Asignatura SYTW16-17&quot;,
    &quot;plugins&quot;: [],
    &quot;structure&quot;: {
    },
    &quot;pluginsConfig&quot;: {
    }
}

A continuaci&#xF3;n, debemos instalarlo con el comando npm install:
npm install  &quot;nombre del plugin&quot; --save-dev

Una vez que encontremos el plugin que necesitamos, debemos a&#xF1;adirlo a nuestro fichero book.json:
{
    &quot;plugins&quot;: [&quot;plugin 1&quot;, &quot;plugin 2&quot;]
}
Los Gitbook Plugins son instalados autom&#xE1;ticamente en Gitbook.com. Localmente, podemos ejecutar el siguiente comando para instalar y preparar todos los plugins para nuestros libros:$ gitbook install

