Plugin Exercises!
Este plugin permite introducir ejercicios interactivos, a modo de que el lector pueda, por ejemplo, escribir la soluci&#xF3;n de un problema para posteriormente el autor del gitbook pueda verificarla y validarla.
&#xBF;C&#xF3;mo podemos instalar este plugin?Debemos instalar el siguiente paquete  y a&#xF1;adirlo a nuestro package.json:$ npm install gitbook-plugin-exercises --save-devUna vez instalado, debemos incorporar el plugin en nuestro fichero book.json{  
  &quot;plugins&quot;: [&quot;exercises&quot;]
}
Finalmente, ejecutamos el siguiente comando para instalar y preparar el plugin:$ gitbook install


